import React, { Component } from 'react';
import {Button, Input, InputGroup, InputGroupAddon, InputGroupText, Col, Row} from 'reactstrap';

class Header extends Component{

    constructor(props) {
		super(props);
		this.toggle = this.toggle.bind(this);
		this.state = {
		  dropdownOpen: false
		};
	}

	toggle() {
		this.setState({
		  dropdownOpen: !this.state.dropdownOpen,
		});
	}

	render(){
		return(
			<Row className="d-flex justify-content-center">
				<Col xs="1" sm="1" md="1"></Col>
				<Col xs="5" sm="5" md="5">
                    Logo
			</Col>
				<Col xs="5" sm="5" md="5" className="text-right">
					<Row>
						<Col xs="9" sm="9" md="9">
							<Row>
								<Col xs={{ size: 10, offset: 2 }} sm={{ size: 10, offset: 2 }} md={{ size: 10, offset: 2 }}>
									<InputGroup  seamless>
										<InputGroupAddon addonType="prepend">
											<InputGroupText style={{ background:'white'}}>
												icono
											</InputGroupText>
										</InputGroupAddon>
										<Input type="text" id="order" name="order" placeholder="Â¿Que quiere buscar?" style={{ borderLeftColor:'#fff'}}/>
										<InputGroupAddon addonType="append">
											<Button type="button" style={{ background:'#14bec9', borderColor:'#ced4da'}}>Buscar</Button>
										</InputGroupAddon>
									</InputGroup>
								</Col>
							</Row>
						</Col>
                    </Row>
				</Col>
				<Col xs="1" sm="1" md="1"></Col>
			</Row>
		)
	}
}

export default Header;
